import React from 'react';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
    const navigate = useNavigate();

    const handleLogout = () => {
        // Add any logout logic here
        navigate('/login');
    };

    return (
        <div className="min-h-screen bg-[#fcfdfe] font-sans text-slate-900">
            {/* Navbar */}
            <nav className="sticky top-0 z-50 bg-white/90 backdrop-blur-md border-b border-slate-100 shadow-sm">
                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                    <div className="flex justify-between h-20 items-center">
                        <div className="flex items-center gap-3">
                            <div className="bg-red-600 p-2.5 rounded-xl shadow-lg shadow-red-100">
                                {/* You might want to use a different icon here */}
                            </div>
                            <div>
                                <h1 className="text-xl font-black text-slate-900">Dashboard</h1>
                                <p className="text-[10px] font-bold text-slate-500 uppercase tracking-widest">Pohon Industri</p>
                            </div>
                        </div>
                        <div className="flex items-center gap-4">
                            <button onClick={handleLogout} className="bg-slate-900 text-white px-6 py-2.5 rounded-xl text-sm font-bold hover:bg-slate-800 transition-all shadow-lg shadow-slate-200">
                                Logout
                            </button>
                        </div>
                    </div>
                </div>
            </nav>

            {/* Dashboard Content */}
            <main className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-12">
                <h1 className="text-4xl font-bold mb-8">Selamat Datang di Dashboard</h1>
                <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
                    {/* Placeholder for dashboard widgets */}
                    <div className="bg-white p-6 rounded-xl shadow-md">
                        <h2 className="text-lg font-bold mb-4">Widget 1</h2>
                        <p>This is a placeholder for a dashboard widget.</p>
                    </div>
                    <div className="bg-white p-6 rounded-xl shadow-md">
                        <h2 className="text-lg font-bold mb-4">Widget 2</h2>
                        <p>This is a placeholder for a dashboard widget.</p>
                    </div>
                    <div className="bg-white p-6 rounded-xl shadow-md">
                        <h2 className="text-lg font-bold mb-4">Widget 3</h2>
                        <p>This is a placeholder for a dashboard widget.</p>
                    </div>
                </div>
            </main>
        </div>
    );
};

export default Dashboard;
